import "./MickeyCard.css";
import mickey from "./mickey.json";

const MickeyCard = props => (
  <div className="card">
    <div className="img-container">
      <img src={mickey.image} key={mickey.id} alt="-mickey-character" />
    </div>
  </div>
);

export default MickeyCard;

